essly adapts to your site\'s current color and typography styles.'=>'異なるコレクションのページを組み合わせて組み合わせることができます。サイトに追加すると、各ページはサイトの現在の色とタイポグラフィのスタイルにシームレスに適応します。','Your site is ready to go!'=>'あなたのサイトの準備が整いました!','You\'ve completed the setup process! Now you can view, edit, and customize your site using the Site Editor and start building with Ollie and Ollie Pro.'=>'セットアッププロセスが完了しました。これで、サイトエディタを使用してサイトを表示、編集、カスタマイズし、OllieとOllie Proで構築を開始できます。','Open your site to check out the live front-end view.'=>'サイトを開いて、ライブフロントエンドビューを確認します。','Go to the Site Editor to view and edit your homepage, navigations, and customize your site with global styles.'=>'サイトエディタに移動して、ホームページやナビゲーションを表示および編集し、グローバルスタイルでサイトをカスタマイズします。','Edit Site'=>'サイトを編集','Edit Your Header and Footer'=>'ヘッダーとフッターの編集','Go to the Site Editor to edit your header and footer template parts and site navigation.'=>'[サイト エディター] に移動して、ヘッダーとフッターのテンプレート パーツとサイト ナビゲーションを編集します。','Visit the dashboard to sign in and unlock the entire Ollie Pro pattern library.'=>'ダッシュボードにアクセスしてサインインし、OllieProパターンライブラリ全体のロックを解除します。','Visit Dashboard'=>'ダッシュボードを見る','View Ollie Docs'=>'Ollie使い方ガイドを見る','Watch tutorial videos and read through the docs to learn how to build beautiful websites with Ollie.'=>'Ollieの使い方動画や使い方ガイドを活用して、美しいWebサイトを構築する方法を学びましょう。','Header and Footer'=>'ヘッダーとフッター','Choose a design for your header and footer. You can customize further in the Site Editor.'=>'ヘッダーとフッターのデザインを選択します。サイトエディタでさらにカスタマイズできます。','Choose your header style'=>'ヘッダーのスタイルを選択する','Header With Navs'=>'ナビゲーション付きヘッダー','Header With Buttons'=>'ボタン付きヘッダー','Header With Banner'=>'バナー付きヘッダー','Do you want a light or dark header?'=>'明るいヘッダーが必要ですか、それとも暗いヘッダーが必要ですか?','Light'=>'ライト','Dark'=>'ダーク','Choose your footer style'=>'フッターのスタイルを選択する','Footer with Nav Columns'=>'ナビゲーション列付きのフッター','Footer Minimal'=>'フッター ミニマル','Footer Centered'=>'フッター中央揃え','Do you want a light or dark footer?'=>'明るいフッターと暗いフッターのどちらが必要ですか?','You can customize your header and footer later in Site Editor → Patterns → Template Parts.'=>'ヘッダーとフッターは、後でサイト エディターの → パターン → テンプレート パーツ] でカスタマイズできます。','Header Preview'=>'ヘッダープレビュー','Header preview'=>'ヘッダープレビュー','Footer Preview'=>'フッタープレビュー','Footer preview'=>'フッターのプレビュー','Select a page'=>'ページを選択','Failed to create a new page.'=>'新しいページを作成できませんでした。','Failed to create a new page. Please try again.'=>'新しいページを作成できませんでした。もう一度お試しください。','Choose a Home page'=>'ホームページを選択する','Select what you\'d like to show on your homepage.'=>'ホームページに表示する内容を選択します。','Your homepage displays:'=>'ホームページには次の情報が表示されます。','Your latest posts'=>'あなたの最新の投稿','A custom page'=>'カスタムページ','Select a homepage'=>'ホームページを選択する','Loading pages...'=>'ページを読み込んでいます...','Choose a Blog page'=>'ブログページを選ぶ','Select a page to display your latest blog posts.'=>'最新のブログ記事を表示するページを選択します。','Select a blog page:'=>'ブログページを選択します。','Success! We created a page called '=>'ページ作成、成功！','. We\'ll use that for your blog.'=>'.それをブログに活用します。','Don\'t have a blog page yet? No problem, we can create one for you real quick.'=>'まだブログページをお持ちでないですか？ご安心ください。すぐに素敵なブログを作成できます。','Create a blog page'=>'ブログページを作成する','Updating preview...'=>'プレビューを更新しています...','Permalink update required'=>'パーマリンクの更新が必要です','Please modify your permalink settings. We can\'t preview your homepage with plain permalinks.'=>'パーマリンクの設定を変更してください。プレーンなパーマリンクでホームページをプレビューすることはできません。','Install Essential Plugins'=>'エッセンシャルプラグインのインストール','These plugins are highly recommended for building a block-based website with Ollie.'=>'これらのプラグインは、Ollieを使ってブロックベースのWebサイトを構築する際に特におすすめです。','The Icon Block'=>'アイコンブロック','Add a collection of customizable icons to your content. Required with Ollie Pro.'=>'カスタマイズ可能なアイコンのコレクションをコンテンツに追加します。Ollie Proで必要です。','Plugin Installed'=>'プラグインがインストール済み','Activate Plugin'=>'プラグインを有効化','Install this plugin (Required)'=>'このプラグインをインストールします (必須)','Control where your blocks appear and who can see them based on simple conditions.'=>'ブロックが表示される場所や、ブロックを表示できるユーザーを制御できるプラグイン。','Install this plugin'=>'このプラグインをインストールする','Enhances the query loop block