t Wizard'=>'クイックスタートウィザード','Welcome to the Ollie Quick Start Wizard. This setup wizard will help you create pages, customize the styles on your site, and much more.'=>'Ollieクイックスタートウィザードへようこそ。このセットアップ ウィザードは、ページの作成、サイトのスタイルのカスタマイズなどに役立ちます。','Start Setup Wizard'=>'セットアップ ウィザードの開始','Welcome to Ollie Pro!'=>'Ollie Proへようこそ!','Visit the Ollie Dashboard (Appearance → Ollie) to activate Ollie Pro, use the setup wizard, and access docs and video tutorials. Head over there to get started!'=>'Ollieダッシュボード(外観→ Ollie)にアクセスして、Ollie Proをアクティブ化し、セットアップウィザードを使用し、ドキュメントやビデオチュートリアルにアクセスできます。でははじめていきましょう！','View Ollie Dashboard →'=>'Ollieダッシュボードを表示 →','Skip for now'=>'今はスキップ','View details'=>'詳細を見る','More information about %s'=>'%sについての詳細','Check for updates'=>'アップデートを確認する','the plugin title' . "\4" . 'The %s plugin is up to date.'=>'%s プラグインは最新です。','the plugin title' . "\4" . 'A new version of the %s plugin is available.'=>'%sプラグインの新しいバージョンが利用可能です。','the plugin title' . "\4" . 'Could not determine if updates are available for %s.'=>'%1$s.に対して利用可能なアップデートがあるか確認できませんでした。','There is no changelog available.'=>'利用可能な変更ログはありません。','Ollie Pro 2.0 requires Ollie theme version 1.4.8 or higher. Please %s before continuing.'=>'Ollie Pro 2.0には、Ollieテーマバージョン1.4.8以降が必要です。続行する前に%sしてください。','update your theme'=>'テーマを更新する','The Ollie Pro plugin needs the free Ollie theme to work. View the theme and install it %s.'=>'Ollie Proプラグインを動作させるには、無料のOllieテーマが必要です。テーマを表示し、%sインストールします。','Ollie Pro'=>'Ollie Pro','https://olliewp.com'=>'https://olliewp.com','Adds the Ollie Pro pattern library and Ollie Pro Dashboard to the Ollie block theme.'=>'OllieブロックテーマにOllie ProパターンライブラリとOllie Proダッシュボードを追加します。','buildwithollie'=>'buildwithollie']];
